import { useState } from 'react';
import ReactDOM from 'react-dom/client';
import "./App.css"; 
import logo from './logo_ict_aac.png';

function MyForm() {
  const [name, setName] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`The name you selected was: ${name}`)
    window.location.reload();
  }

  const handleChange = (event) => {
    setName(event.target.value);
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="logo-title-container"> {/* Kontejner za logo i naslov */}
        <div className="logo-container"> {/* Kontejner za logo */}
          <img src={logo} alt="Logo" className="logo" /> {/* Logo */}
        </div>
        <h1 className="form-title">Form in React</h1> {/* Naslov */}
      </div>
      <br /><br />
      <label>Select aplication name:</label>
      <select value={name} onChange={handleChange}>
        <option value="apl1">apl1</option>
        <option value="apl2">apl2</option>
        <option value="apl3">apl3</option>
      </select>
      <br /><br />
      <input type="submit" />
    </form>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MyForm />);
